import React from "react";
import { NavHashLink } from 'react-router-hash-link';

function Logo() {
    return (
        <NavHashLink to="#" className="logo">
            <img src="../images/logo.png" width="120" height="80" alt="michael scales logo" />
        </NavHashLink>

    );
}

export default Logo;
